import React from "react";
import { Card, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
// import FeatureCard from '../other_componets/Css/FeatureCard'
import FeatureCard from '../other_componets/Css'
function FeaturesCard(props) {
  // const handel={
  //   onclick,
  // }

  return (
    <>
      <div>
        {/* <h3>Demo</h3> */}
        <div className="m-5">
          <Card className="Card">
            <Card.Img 
                className="CardImg" 
                variant="top"
                src={props.Img} />
            <Card.Body>
              <Card.Title>{props.Title}</Card.Title>
              <Card.Text>
                <p>
                  <b>Use:</b>&nbsp;&nbsp;{props.Text}
                </p>
                {/* <li><b>Colour:</b>&nbsp;&nbsp;{props.color}</li> */}
              </Card.Text>
              <div className="buttonalign">
                <Button variant="primary">
                  <Link
                    to={props.Link}
                    target={"_blank"}
                    style={{ color: "white" }}
                  >
                    More Details
                  </Link>
                </Button>
              </div>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default FeaturesCard;
